property.code:
document.observe('xwiki:dom:loaded', function () {
  $$(".citation .bibtex-link").invoke('observe', 'click', function(event) {
    event.stop();
    event.findElement('.citation').toggleClassName('active');
  });
  document.documentElement.observe('click', function(event) {
    if (!event.findElement('.bibtex')) {
      $$(".citation").invoke('removeClassName', 'active');
    }
  });
})

